FN = (str)=>{
  toHashNum = (m, v) => {

    let pos = m[v] !== undefined ? m[v] : Object.keys(m).length;
    //console.log(v,pos, m[v])
    return Object.assign(m, {[v]: pos})
  }
  toHashNum2 = ([mH,m], v) => {

    let pos = m[v] !== undefined ? m[v] : Object.keys(m).length;
    if(m[v] === undefined)
      mH.push(v)
    //console.log(v,pos, m[v])
    return [mH, Object.assign(m, {[v]: pos})]
  }

  words = str
    .replace(/\t|\n/g, ' ')
    .split(' ')
    .slice(0,3000)
    .map(v=>v.replace(/[^#a-zA-Zа-яА-Я0-9]+/g,''))
    .filter(v=>v.trim());

  getflow = list=>{

    let [index, hash] = list.reduce(toHashNum2, [[],{}]);

    toFlow = (m, curr, i)=>{
      if(i==0) 
        return[curr,[]];

      let [prev, bank] = m;
      let arr = [...bank, [hash[prev], hash[curr], prev, curr]];

      return [curr, arr];
    }

    return {
      list:list.reduce(toFlow, [])[1],
      index, hash
    };
  }
  flow = getflow(words);
  len = flow.index.length;
  matrix = Array(len).fill().map(()=>Array(len).fill(0));

  for(l of flow.list){
    let [x,y] = l;
    matrix[x][y] = matrix[x][y]+1 || 1;
  }

  points = matrix.reduce((m,r,x)=>[
    ...m,
    ...r.map((c,y)=>[x,y,c])
  ],[]).filter(v=>v[2]);

  //points = flow.list;


  K = 6
  offset = 10;
  size = flow.index.length * K + offset*2;
  max = points.reduce((m,v)=>Math.max(m,v[2]),1)
  console.clear();


  draw = ()=>{
    var canvas = document.getElementById('cnv');
    if (canvas.getContext) {
      ctx = canvas.getContext('2d');

      ctx.fillStyle = 'white';
      ctx.fillRect(0, 0, size, size);


      for(let [x,y,c] of points){
        if(c!==null){

          clr = `hsl(${(100 - 100 * (c-1) / (max-1))|0}, 80%, 35%)`;
          //console.log(x,y,c,clr)
          let [px, py] = [x,y].map(v=>v*K+offset);

          ctx.fillStyle = clr;
          ctx.fillRect(py, px, K, K);
        }
      }



      durl = canvas.toDataURL();
      document.getElementById('cimg').setAttribute('src', durl)
    }
  }

  setTimeout(draw,50);
}

